import React, {
    useState,
    useEffect
} from 'react';
import {
    getMenu
} from "./apiAdmin";


function DynamicMenu() {
    const [menu, setMenu] = useState([]);

    const {
        user,
        token
    } = isAuthenticated();


    const loadMenu = () => {
        getMenu().then(data => {
            if (data.error) {
                console.log(data.error);
            } else {
                setMenu(data);
            }
        });
    };

    useEffect(() => {
        loadMenu();
    }, []);


    return ( <
        div >

        <
        ul className = "nav nav-tabs bg-primary" > {
            data.map((item, i) =>
                <
                li className = "nav-item"
                key = {
                    i
                } > {
                    data.name
                } <
                /li>
            )
        } <
        /ul>             

        <
        /div>
    )

}

export default DynamicMenu;
